import React from "react";

export default function MotorProperties() {
  return (
    <>
      <section className="mtProperties-layout">
        <div className="mtProperties-container"></div>
        <div className="mtProperties-Picture">
          <picture>
            <img alt="" src="./img/rush1000/properties.webp"></img>
          </picture>
        </div>
      </section>
    </>
  );
}
